const axios = require('axios');



class ElevationDataRequest {
  static async getElevationData (latitude, longitude) {
    try {
      const url = `https://api.open-elevation.com/api/v1/lookup?locations=${latitude},${longitude}`;
      const response = await axios.get(url);
      return response.data;
    } catch (error) {
      console.error(`Error fetching elevation data: ${error.message}`);
      return null;
    }
  };
}


export default ElevationDataRequest;
